const Input=()=>{
    return (
        <div
        className={`${classes.control} ${
          emailState.isvalid ? classes.isvalid : ''
        }`}
      >
        <label htmlFor="email">E-Mail</label>
        <input
         type="email"
         id="password"
                   value={emailState.val}
          onChange={emailChangeHandler}
          onBlur={validateEmailHandler}
        />
      </div>
    )
}
export default Input;
